<td>ASTRON(アストロン)</td>
</tr>
<tr>
<th>ムーブメント</th>
<td>ソーラーGPS衛星電波修正 Cal.8X22<br>
精度:非受信時平均月差±15秒</td>
</tr>
<tr>
<th>素材</th>
<td>
ケース・裏ぶた：純チタン(ダイヤシールドコーティング)<br>
ベゼル：セラミックス<br>
風防：サファイアガラス（スーパークリア コーティング）<br>

（※）スーパークリア コーティング： 光の反射を99％以上抑制する透明被膜を、<br>
ガラスの表裏両面に施したセイコー独自の無反射コーティング処理です。<br>
太陽光や照明がまぶしい環境下でも、ガラスの存在を意識させません。<br>
また、表面の防汚膜により汚れがついても簡単に拭き取ることができます。
</td>
</tr>
<tr>
<th>サイズ</th>
<td>
ケース径：縦55.8mm x 横44.8mm x 厚さ12.4mm<br>
</td>
</tr>
<tr>
<th>重量</th>
<td>111g</td>
</tr>
<tr>
<th>防水性</th>
<td>日常生活用強化防水(10気圧)</td>
</tr>
<tr>
<th>その他特徴</th>
<td>
スクリューバック<br>
耐メタルアレルギー<br>
過充電防止機能<br>
パワーセーブ機能<br>
パーペチュアルカレンダー機能<br>
ワールドタイム機能(40タイムゾーン)<br>
パワーリザーブ表示機能<br>
GPS衛星電波受信による タイムゾーン修正機能・スマートセンサー(自動時刻修正機能)・強制時刻修正機能<br>
捕捉衛星数表示機能<br>
受信結果表示機能<br>
受信オフ機能(機内モード)<br>
針位置自動修正機能<br>
ルミブライト：あり(針・インデックス)
</td>
</tr>
<tr>
<th>サイズ調整について</th>
<td>お客様のご希望により、ブレスレットのサイズを調整した上で、<br>
時計をお届けいたします。(サイズ調整無料)<br>
時計を装着する手首回りの長さをメジャーなどで計測いただき、<br>
その長さをご注文の際にお知らせ下さい。<br>
（コマを外した場合は、外したコマも時計と一緒にお送り致します。）<br>
<font color="#cc0000;">※サイズの調整をいたしますと返品、交換はお受けいたしかねますのでご了承下さい。</font>
</td>
</tr>
<tr>
