<td>メーカー保証　1年<br>
お買い上げの時計が、取り扱い説明書に沿った正常な使用状態で故障した場合、取り扱い説明書の記載内容の範囲で、保証期間に限り、無償修理致します。<br><br>
<b>■保証対象について</b><br>
 時計本体（ムーブメント・ケース）および金属バンドです。それ以外は保証の対象外です。<br>
修理のとき、ムーブメントを交換させていただいたり、ケース・文字板、針、ガラス・バンドなどに、一部代替部品を使用させていただくこともありますので、ご了承ください。
</td>
</tr>
