<p style="font-size:14px;line-height:150%;color: #fff;">
9S系キャリバーは、歴史と伝統、そして更なる先進技術の融合から誕生した、最高級のメカニカルムーブメントです。<br>
<br>
●『グランドセイコー』の名を冠することへのこだわり<br>
SEIKO独自の「グランドセイコー規格※」に基ずく検定試験に合格したムーブメントだけが、『グランドセイコー』の称号を与えられ、完成品として組み立てられます。<br>
※「グランドセイコー規格」の検定試験では、ケース組み込み前のムーブメント単体を6姿勢差・3温度差の環境下に置き、17日間かけて精度を実測します。ここで計測された精度を、静的精度と呼びます。<br>
したがって、実際に使用したときの精度（携帯精度）は、日差－1～＋10秒が目安です。<br>
<br>
●『信頼』の品質<br>
高度な精密加工技術により製造された各部品は、寸法誤差が非常に少ない作りこみがされています。<br>
それは精度の高さのみならず、メンテナンス性の良さなど基本品質の高さにもつながっています。<br>
<br>
●高精度へのこだわり<br>
卓越した技術者の手作業により一つずつ丁寧に組み立て、精度調整が行われています。
</p>

